import React, { Component } from "react";

import logo from "../assets/logo.svg";
import UserProfileForm from "./UserProfileForm";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { withAuth0 } from '@auth0/auth0-react';
const axios = require('axios');

class TransactionView extends Component {

    constructor(props) {
        super(props);
        const { user, isAuthenticated } = this.props.auth0;
        this.state = {showCreate: false, email: user && user.email ? user.email : false , userFound : false, isAuthenticated: isAuthenticated}
        this.getTransactions = this.getTransactions.bind(this);
        this.state.accountNumber = 137813372;
    }

    componentDidMount() {
        let currentComponent = this;
        this.getTransactions(currentComponent);
    }
    getTransactions(currentComponent){
        axios.get('http://localhost:8080/transactions/account/' + currentComponent.state.accountNumber).then(function (response) {
        if(response && response.data && response.data.transactions){
            currentComponent.setState({transactions: response.data.transactions});
        }else{
            currentComponent.setState({transactions: null});
        }
        }).catch(function (error) {
          // handle error
          console.log(error);
      })
    }

    render() {

        return (
          <div>
              <table class="table">
  <thead>
    <tr>
      <th><abbr title="Index">Transaction Id</abbr></th>
      <th>Type</th>
      <th><abbr title="Frequency">Frequency</abbr></th>
      <th><abbr title="Amount">Amount</abbr></th>
      <th><abbr title="fm_acc">From Account</abbr></th>
      <th><abbr title="status">Status</abbr></th>
      <th><abbr title="date">Date</abbr></th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th></th>
      <td><a href="https://en.wikipedia.org/wiki/Leicester_City_F.C." title="Leicester City F.C.">Leicester City</a> <strong>(C)</strong>
      </td>
      <td>38</td>
      <td>23</td>
      <td>12</td>
      <td>3</td>
    </tr>
  </tbody>
</table>
          </div>
        )
    };
}

export default withAuth0(TransactionView);
